import React from 'react';

import classes from './AddInterview.module.css';

const AddInterview = (props) => {
    const addInterviewHandler = (event) => {
        event.preventDefault();
    };

    return (
        <form onSubmit={addInterviewHandler}>
            <button className={classes.addInterviewButton} type="submit">Create Interview</button>
        </form>
    );
};

export default AddInterview;
